    # Map Minimum and Maximum Input Processing Function
    
@function
def mapminmax_apply(x=None,settings_gain=None,settings_xoffset=None,settings_ymin=None,*args,**kwargs):

    y = x-settings_xoffset
    y = y*(settings_gain)
    y = y+settings_ymin
    return y
    
