    # Sigmoid Symmetric Transfer Function
    
@function
def tansig_apply(n=None,*args,**kwargs):
    varargin = tansig_apply.varargin
    nargin = tansig_apply.nargin

    a=2 / (1 + exp(dot(- 2,n))) - 1
    return a
    
