    # Map Minimum and Maximum Output Reverse-Processing Function
    
@function
def mapminmax_reverse(y=None,settings_gain=None,settings_xoffset=None,settings_ymin=None,*args,**kwargs):

    x = y - settings_ymin
    x = x/settings_gain
    x = x + settings_xoffset

    return x
    
